function CarList({ cars }) {
  return (
    <div>
      <h2>Lista de Carros</h2>
      <ul>
        {cars.map((car, index) => (
          <li key={index}>
            {car.name} - {car.brand} - {car.color} - {car.year}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default CarList;
